import React, { useEffect } from 'react'
import '../mobilepages/mwd.css'

function Mwd() {

  return (
    <>
        <div className='mwd-container'>
        <h1><mark style={{ backgroundColor: '#fff', color: 'black' }}>Hi, I'm Dan</mark></h1>
          <p><mark style={{ backgroundColor: '#3498db'}}>As a web developer, I possess a comprehensive skill set in designing and building responsive, user-friendly websites. With expertise in front-end technologies such as HTML, CSS, and JavaScript.</mark></p>
        </div>
    </>
  )
}

export default Mwd
